import React from 'react'
import Navbar from './Navbar'
import Newsletter from './Newsletter'

function About() {
  return (
    <>
    <div>
        <Navbar/>

        <h1>THIS IS THE ABOUT PAGE</h1>
        <div className='w-[400px]  h-[400px] mx-auto bg-[#F1F8FF] justify-items-center'style={{
        textAlign: "center"
      }}>
        </div>
        <Newsletter/>
    </div>
    </>
  )
}

export default About
